mapper.select:
select 
from cloud_parking_space


   and web_url = #{webUrl,jdbcType=VARCHAR}


    and collect_flag = #{collectFlag,jdbcType=VARCHAR}


    and  rent_sale_flag = #{rentSaleFlag,jdbcType=VARCHAR}


    and publish_source = #{publishSource,jdbcType=VARCHAR}


    and publish_time = #{publishTime,jdbcType=VARCHAR}


    and publish_man_name = #{publishManName,jdbcType=VARCHAR}


    and publish_man_phone = #{publishManPhone,jdbcType=VARCHAR}


    and parking_name = #{parkingName,jdbcType=VARCHAR}


    and price_one = #{priceOne,jdbcType=VARCHAR}


    and price_two = #{priceTwo,jdbcType=VARCHAR}


    and parking_catagory = #{parkingCatagory,jdbcType=VARCHAR}


    and parking_acreage = #{parkingAcreage,jdbcType=VARCHAR}


    and first_pay = #{firstPay,jdbcType=VARCHAR}


    and parking_type = #{parkingType,jdbcType=VARCHAR}


    and  parking_address = #{parkingAddress,jdbcType=VARCHAR}


    and parking_desc = #{parkingDesc,jdbcType=VARCHAR}


    and  pics = #{pics,jdbcType=VARCHAR}


    and begin_rent_time = #{beginRentTime,jdbcType=VARCHAR}


    and pay_method = #{payMethod,jdbcType=VARCHAR}


    and remaining_rent_time = #{remainingRentTime,jdbcType=VARCHAR}


    and  longitude = #{longitude,jdbcType=VARCHAR}


    and latitude = #{latitude,jdbcType=VARCHAR}


    and province_name = #{provinceName,jdbcType=VARCHAR}


    and province_code = #{provinceCode,jdbcType=VARCHAR}


    and city_name = #{cityName,jdbcType=VARCHAR}


    and city_code = #{cityCode,jdbcType=VARCHAR}


    and county_name = #{countyName,jdbcType=VARCHAR}


    and county_code = #{countyCode,jdbcType=VARCHAR}


    and backup1 = #{backup1,jdbcType=VARCHAR}


    backup2 = #{backup2,jdbcType=VARCHAR}


    and backup3 = #{backup3,jdbcType=VARCHAR}


    and add_time = #{addTime,jdbcType=TIMESTAMP}


    and update_time = #{updateTime,jdbcType=TIMESTAMP}


    and syn_real = #{synReal}


limit 0,#{pageSize}
